#include "PX_Object_Box.h"


PX_Object_COMBox_Return PX_Object_COMBoxGetReturn(PX_Object *pObject)
{
	PX_Object_COMBox_Return info;
	PX_Object_COMBox* pDesc;

	pDesc = (PX_Object_COMBox *)PX_ObjectGetDescByType(pObject,PX_OBJECT_TYPE_COMBOX);
	PX_ASSERTIF(!pDesc);
	PX_strcpy(info.com, PX_Object_VariousGetText(pDesc->various_com),sizeof(info.com));
	switch (PX_Object_VariousSelectBarGetCurrentIndex(pDesc->various_baudrate))
	{
	case 0:
		info.baudRate=300;
		break;
	case 1:
		info.baudRate=600;
		break;
	case 2:
		info.baudRate=1200;
		break;
	case 3:
		info.baudRate=2400;
		break;
	case 4:
		info.baudRate=4800;
		break;
	case 5:
		info.baudRate=9600;
		break;
	case 6:
		info.baudRate=19200;
		break;
	case 7:
		info.baudRate=38400;
		break;
	case 8:
		info.baudRate=56000;
		break;
	case 9:
		info.baudRate=57600;
		break;
	case 10:
		info.baudRate=115200;
		break;
	default:
		info.baudRate=128000;
		break;
	}

	switch(PX_Object_SelectBarGetCurrentIndex(pDesc->various_databits))
	{
	case 0:
		info.DataBits=5;
		break;
	case 1:
		info.DataBits=6;
		break;
	case 2:
		info.DataBits=7;
		break;
	case 3:
		info.DataBits=8;
		break;
	default:
		info.DataBits=8;
		break;
	}

	switch(PX_Object_SelectBarGetCurrentIndex(pDesc->various_stopbits))
	{
	case 0:
		info.stopBit=1;
		break;
	case 1:
		info.stopBit=1;
		break;
	case 2:
		info.stopBit=2;
		break;
	default:
		info.stopBit=1;
		break;
	}

	switch(PX_Object_SelectBarGetCurrentIndex(pDesc->various_parity))
	{
	case 0:
		info.ParityType='N';
		break;
	case 1:
		info.ParityType='E';
		break;
	case 2:
		info.ParityType='O';
		break;
	case 3:
		info.ParityType='M';
		break;
	default:
		info.ParityType='N';
		break;
	}
	return info;
}

PX_OBJECT_EVENT_FUNCTION(PX_Object_COMBoxOnConfirm)
{
	PX_Object_COMBox* pdesc;
	pdesc = (PX_Object_COMBox*)PX_ObjectGetDescByType((PX_Object*)ptr, PX_OBJECT_TYPE_COMBOX);
	PX_ASSERTIF(!pdesc);

	PX_ObjectExecuteEvent(((PX_Object*)ptr), PX_OBJECT_BUILD_EVENT(PX_OBJECT_EVENT_EXECUTE));
	PX_Object_COMBoxClose((PX_Object*)ptr);
}


PX_OBJECT_EVENT_FUNCTION(PX_Object_COMBoxOnCancel)
{
	PX_Object_COMBoxClose((PX_Object*)ptr);
}

