/// PainterBox
PX_Object_PainterBox* PX_Object_GetPainterBox(PX_Object* pObject)
{
	PX_Object_PainterBox* pDesc = (PX_Object_PainterBox*)PX_ObjectGetDescByType(pObject, PX_OBJECT_TYPE_PAINTERBOX);
	PX_ASSERTIF(pDesc == PX_NULL);
	return pDesc;
}


px_float PX_Object_PainterBoxGetToolSize(PX_Object* pObject)
{
	PX_Object_PainterBox* pdesc = PX_Object_GetPainterBox(pObject);
	return PX_Object_SliderBarGetValue(pdesc->sliderbar_size) * 1.0f;
}

px_float PX_Object_PainterBoxGetToolAlpha(PX_Object* pObject)
{
	PX_Object_PainterBox* pdesc = PX_Object_GetPainterBox(pObject);
	return PX_Object_SliderBarGetValue(pdesc->sliderbar_alpha) / 255.0f;
}

px_color PX_Object_PainterBoxGetToolColor(PX_Object* pObject)
{
	px_color clr;
	px_int alpha;
	PX_Object_PainterBox* pdesc = PX_Object_GetPainterBox(pObject);

	clr = PX_Object_ColorPanelGetColor(pdesc->color_panel);
	alpha = PX_Object_SliderBarGetValue(pdesc->sliderbar_alpha);
	clr._argb.a = (px_byte)alpha;
	return clr;
}

px_float PX_Object_PainterBoxGetToolSmooth(PX_Object* pObject)
{
	PX_Object_PainterBox* pdesc = PX_Object_GetPainterBox(pObject);
	return PX_Object_SliderBarGetValue(pdesc->sliderbar_smooth) * 1.0f;
}

px_void PX_Object_PainterBoxOnResetToolsColor(PX_Object* pObject)
{
	PX_Object_PainterBox* pdesc = PX_Object_GetPainterBox(pObject);
	PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_pen), PX_COLOR_WHITE);
	PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_eraser), PX_COLOR_WHITE);
	PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_spray), PX_COLOR_WHITE);
	PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_paint), PX_COLOR_WHITE);
	PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_hand), PX_COLOR_WHITE);
}

px_void PX_Object_PainterBoxOnRenderPresent(PX_Object* pObject)
{
	PX_Object_PainterBox* pdesc = PX_Object_GetPainterBox(pObject);
	px_float tool_size;
	px_float tool_alpha;
	px_color tool_color, h_tool_color;
	if (1)
	{
		PX_SurfaceClear(&pdesc->present, 0, 0, 0xffff, 0xffff, PX_COLOR(255, 255, 255, 255));
		tool_size = PX_Object_PainterBoxGetToolSize(pObject);
		tool_alpha = PX_Object_PainterBoxGetToolAlpha(pObject);
		tool_color = PX_Object_PainterBoxGetToolColor(pObject);
		tool_color._argb.a = (px_byte)(tool_alpha * 255);
		h_tool_color = tool_color;
		h_tool_color._argb.a /= 4;
		switch (pdesc->tool_type)
		{
		case PX_OBJECT_PAINTERBOX_TOOL_TYPE_NONE:
			break;
		case PX_OBJECT_PAINTERBOX_TOOL_TYPE_PEN:
		{
			PX_Object_PainterBoxOnResetToolsColor(pObject);
			PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_pen), h_tool_color);
			PX_GeoDrawPenCircle(&pdesc->present, pdesc->present.width / 2.f, pdesc->present.height / 2.f, tool_size, tool_color);
		}
		break;
		case PX_OBJECT_PAINTERBOX_TOOL_TYPE_PAINT:
		{

			PX_Object_PainterBoxOnResetToolsColor(pObject);
			PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_paint), h_tool_color);
			PX_GeoDrawRect(&pdesc->present, pdesc->present.width / 2 - 32, pdesc->present.height / 2 - 32, pdesc->present.width / 2 + 32, pdesc->present.height / 2 + 32, tool_color);
		}
		break;
		case PX_OBJECT_PAINTERBOX_TOOL_TYPE_SPRAY:
		{
			PX_Object_PainterBoxOnResetToolsColor(pObject);
			PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_spray), h_tool_color);
			PX_GeoDrawSpray(&pdesc->present, pdesc->present.width / 2.f, pdesc->present.height / 2.f, tool_size, tool_color);
		}
		break;
		case PX_OBJECT_PAINTERBOX_TOOL_TYPE_ERASER:
		{
			px_int x, y;
			PX_Object_PainterBoxOnResetToolsColor(pObject);
			PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_eraser), h_tool_color);
			for (x = 0; x < 64; x++)
			{
				px_color clr = tool_color;
				clr._argb.a = 255 - clr._argb.a;
				clr._argb.a = (px_byte)(clr._argb.a * (1 - x / 64.f));
				for (y = 0; y < 64; y++)
				{
					PX_SurfaceDrawPixel(&pdesc->present, pdesc->present.width / 2 - 32 + x, pdesc->present.height / 2 - 32 + y, clr);
				}
			}

		}
		break;
		case PX_OBJECT_PAINTERBOX_TOOL_TYPE_HAND:
		{
			PX_Object_PainterBoxOnResetToolsColor(pObject);
			PX_Object_PushButtonSetBackgroundColor(PX_Object_CursorButtonGetPushButton(pdesc->button_hand), h_tool_color);
			PX_SurfaceClearAll(&pdesc->present, PX_COLOR_NONE);
		}
		break;
		}
	}

}

