PX_OBJECT_PAINTERBOX_TOOL_TYPE PX_Object_PainterBoxGetCurrentTool(PX_Object* pObject)
{
	PX_Object_PainterBox* pPainterBox = PX_Object_GetPainterBox(pObject);
	PX_ASSERTIF(pPainterBox == PX_NULL);
	return pPainterBox->tool_type;

}
